import React from "react";
import { HorizontalBar } from "react-chartjs-2";

class MovementDataDisplay extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    let stacked = {};
    if (this.props.Stacked === true) {
      stacked = {
        xAxes: [{ stacked: true }],
        yAxes: [{ stacked: true }]
      };
    } else {
      stacked = {
        xAxes: [{ stacked: false }],
        yAxes: [{ stacked: false }]
      };
    }

    return (
      <div className="Movement">
        <HorizontalBar
          data={{
            labels: [this.props.Labels1,this.props.Labels2],
            datasets: [
              {
                data: this.props.Set1,
                backgroundColor: ["rgb(255, 100, 183)", "rgb(233, 208, 178)"]
              },
              {
                data: this.props.Set2,
                backgroundColor: ["rgb(200, 100, 183)", "rgb(233, 100, 178)"]
              }
            ]
          }}
          options={{
            maintainAspectRatio: false,
            responsive: true,
            title: {
              display: true,
              text: this.props.Title,
              fontSize: 25
            },
            legend: { display: false },
            scales: stacked
          }}
          height={300}
          width={800}
        />
      </div>
    );
  }
}

export default MovementDataDisplay;
